def to_numeric(s):
    """Converts string `s` to a float.

    Invalid strings and NaN values will be converted to float('nan').
    """

    if isinstance(s, str):
        s = s.replace(",", '')
        s = pd.to_numeric(s, errors="coerce")
    return float(s)

def get_number_list(s):
    """Get a list of integers contained in string `s`
    """
    return [int(n) for n in re.findall("(\d+)", str(s))]

def get_number_list_clean(s):
    """Return a clean list of numbers contained in `s`.

    Additional cleaning includes removing numbers that are not of interest
    and standardizing return list size.
    """

    n_list = get_number_list(s)
    n_list += [-1]*(6-len(n_list))
    return n_list

def get_number(s):
    """Get the first number contained in string `s`.

    If `s` does not contain any numbers, return -1.
    """
    n_list = get_number_list(s)
    return n_list[0] if len(n_list) >= 1 else -1

def find_area_at_rank(l, i):
    """Return the area at a certain rank in list `l`.

    Areas are indexed starting at 1 as ordered in the survey.

    If area is not present in `l`, return -1.
    """
    return l.index(i) + 1 if i in l else -1

def cat_in_s(s, cat):
    """Return if a category is present in string `s` as an binary integer.
    """
    return int(cat in s) if not pd.isna(s) else 0 

def softmax(z):
    """
    Softmax Activation Function.
    """
    if z.ndim == 1:
      tmp = np.subtract(z.T, np.max(z)).T
      tmp = tmp.astype(float)
      sum = np.sum(np.exp(tmp))
    else:
      tmp = np.subtract(z.T, np.max(z, axis=1)).T
      tmp = tmp.astype(float)
      sum = np.sum(np.exp(tmp), axis=1)
    return (np.exp(tmp).T / sum).T

def logistic(z):
    """
    Sigmoid Activation Function.
    """
    z = z.astype(float)
    return 1/(1+np.exp(-z))

def predict(X):
    """
    Given the matrix feature X, make predictions using MLP model.
    """
    # randomly choose between the four choices: 'Dubai', 'Rio de Janeiro', 'New York City' and 'Paris'.
    # NOTE: make sure to be *very* careful of the spelling/capitalization of the cities!!
    m = np.add(np.matmul(X, W1), b1)
    # relu activation function hidden layer
    # h = np.maximum(0, m)
    # logistic activation function hidden layer
    h = logistic(m)
    z = np.add(np.matmul(h, W2), b2)
    y = softmax(z)
    # return the prediction
    return y

def parse_data(filename: str) -> np.ndarray:
    """
    Returns a vectorized representation of the data.
    """
    data = pd.read_csv(filename)

    data["Q1"] = data["Q1"].apply(get_number)
    data["Q2"] = data["Q2"].apply(get_number)
    data["Q3"] = data["Q3"].apply(get_number)
    data["Q4"] = data["Q4"].apply(get_number)

    data["Q6"] = data["Q6"].apply(get_number_list_clean)

    data["Q7"] = data["Q7"].apply(to_numeric).fillna(0)
    data["Q8"] = data["Q8"].apply(to_numeric).fillna(0)
    data["Q9"] = data["Q9"].apply(to_numeric).fillna(0)

    temp_names = []
    for i in range(1,7):
        col_name = f"rank_{i}"
        temp_names.append(col_name)
        data[col_name] = data["Q6"].apply(lambda l: find_area_at_rank(l, i))
    del data["Q6"]

    new_names = []
    for col in ["Q1", "Q2", "Q3", "Q4"] + temp_names:
        values = [-1, 1, 2, 3, 4, 5, 6] if col in temp_names else [-1, 1, 2, 3, 4, 5]
        indicators = pd.get_dummies(pd.Series(data[col], dtype=pd.CategoricalDtype(categories=values)), prefix=col)
        new_names.extend(indicators.columns)
        data = pd.concat([data, indicators], axis=1)
        del data[col]

    for cat in ["Partner", "Friends", "Siblings", "Co-worker"]:
      cat_name = f"Q5{cat}"
      new_names.append(cat_name)
      data[cat_name] = data["Q5"].apply(lambda s: cat_in_s(s, cat))
    del data["Q5"]

    data = data[new_names + ["Q7"]]
    return data.values

def predict_all(filename):
    """
    Make predictions for the data in filename
    """
    X = parse_data(filename)
    y = predict(X)
    predictions = []
    for row in y:
        if max(row) == row[0]: predictions.append('Dubai')
        elif max(row) == row[1]: predictions.append('New York City')
        elif max(row) == row[2]: predictions.append('Paris')
        else: predictions.append('Rio de Janeiro')
    return predictions

